import "../src/css/Deals.css"

function Deal() {
    return (
        <>

        <div id="deal">

                <h1 style={{ fontFamily: "Montserrat", paddingLeft: 30 }}>Hot Deals</h1>

        <div className="a-container">

        <DealsData image={buyoffer}/>
        <DealsData image={repairoffer}/>
        <DealsData image={exchangeoffer}/>

        </div>

        </div>
        </>
    )    
}

export default Deal;
